def Panduansushu():
    n=int(input("请输入一个整数："))
    flag=True
    for i in range(2,int(n/2)):
        if n%i==0:
            flag=False
            break
    if flag==True:
        print("%s是素(质)数" % n)
    else:
        print("%s不是素(质)数" % n)

