def shuixianhuashu():
    count=0
    print("水仙花数")
    for i in range(100,1000):
        bai=int(i/100)
        shi=int(i/10)%10
        ge=i%10
        if ge*ge*ge+shi*shi*shi+bai*bai*bai==i:
            count+=1
            print(i,end=' ')
    print()
    print("一共有%s个水仙花数" % count)

